import React, { useRef } from 'react';

const Breadcrumbs = () => {
  const breadcrumbsRef = useRef([]);

  const handleBreadcrumbClick = (index) => {
    const updatedBreadcrumbs = breadcrumbsRef.current.slice(0, index + 1);
    breadcrumbsRef.current = updatedBreadcrumbs;
    console.log('Breadcrumbs:', breadcrumbsRef.current);
  };

  return (
    <div>
      {breadcrumbsRef.current.map((breadcrumb, index) => (
        <span key={index} onClick={() => handleBreadcrumbClick(index)}>
          {breadcrumb}
        </span>
      ))}
    </div>
  );
};

export default Breadcrumbs;
